import React from 'react';

const Projects = () => {
  return (
    <div className="p-4">
      <h1 className="text-3xl font-bold mb-4">Projects</h1>
      <ul className="list-disc list-inside">
        <li className="text-lg">Project 1: Portfolio Website</li>
        <li className="text-lg">Project 2: Blogging Platform</li>
        <li className="text-lg">Project 3: E-commerce App</li>
      </ul>
    </div>
  );
};

export default Projects;
